import React,{Component} from 'react';
import './App.css';
import axios from 'axios';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = { data:[{Name: ""}] }
  }
  componentDidMount() {
    console.log(123);

    axios.get("http://localhost:8000/search/city?query=chennai").then(result=>{this.setState({data:result.data});console.log(result,1)})
  }
  render() { 
    console.log(123);
    return ( <div style="width:300px;heigh:100px;">
      {this.state.data.map(e=><h1>{e.Name}</h1>)}
    </div> );
  }
}

export default App;
